const textForModal = [
    {
        title: "It's ok, don't worry",
        text: "Try next time"
    },

    {
        title: "Perfect",
        text: "You were better then 30% of all quizers"
    },

    {
        title: "Perfect",
        text: "You were better then 60% of all quizers"
    },

    {
        title: "Wow!!!",
        text: "You were better then 99% of all quizers"
    }
]

export default textForModal
